// eslint-disable-next-line
// import Dashboard from './Dashboard';
import './AccountSideBar.css';
import {Link} from 'react-router-dom';
const AccountSideBar = () => {
  return (
    <div className="md:col-span-1 border-r border-neutral-200 pb-8 ">
      <div className="flex profile-picture">
        <p className="font-semibold text-md text-neutral-500">profileName</p>
        <span className="text-muted text-small px-2 italic text-neutral-500">#id</span>
      </div>
      <ul className='sideBarNav flex-row py-4 mt-2'>
        <Link to='/dashboard' className="text-sm font-semibold text-neutral-500">
          <li className="pr-full w-full border-b py-2 active">
          Dashboard
          </li>
        </Link>
        <Link to='events' className="text-sm font-semibold text-neutral-500">
          <li className="pr-full w-full border-b py-2 active">
          Movies
          </li>
        </Link>

      </ul>

    </div>
  );
};

export default AccountSideBar;
